let products = [];

export const addProduct = (product) => {
  products.push(product);
  alert('Product added!');
};

export const getProducts = () => {
  return Promise.resolve(products);
};

export const deleteProduct = (index) => {
  products.splice(index, 1);
  alert('Product deleted!');
};
